css:
.nuclide-ui-message {
  border: 1px solid rgba(0, 0, 0, 0.5);
  border-radius: 2px;
  margin: 4px;
  padding: 8px;
  border-left-width: 4px;
  line-height: 2;
}
.nuclide-ui-message-default {
  border-color: #6d4c1f;
}
.nuclide-ui-message-error {
  color: #cb3434;
  border-color: #cb3434;
}
.nuclide-ui-message-info {
  color: #3ea1e4;
  border-color: #3ea1e4;
}
.nuclide-ui-message-success {
  color: #17ca65;
  border-color: #17ca65;
}
.nuclide-ui-message-warning {
  color: #f5e11d;
  border-color: #f5e11d;
}
